import ChildComponent from './ChildComponent';

class UserGreetingIfElseShortCircuit extends Component {

    constructor(props) {

        super(props)

        this.state = {

            isLoggedin: false

        }

    }


    render() {

        return (this.state.isLoggedin ?
            (<div>Hello, AAAA</div>) :
            (<div>Hello, BBBB</div>)
        )

    }
}

export default UserGreetingIfElseShortCircuit
